    t[173] = "\u0625\u0630\u0627 \u0643\u0646\u062a \u0644\u0627 \u062a\u0631\u063a\u0628 \u0641\u064a \u0632\u064a\u0627\u0631\u0629 \u0647\u0630\u0627 \u0627\u0644\u0645\u0636\u064a\u0641\u060c \u0627\u0646\u0642\u0631 \u0641\u0648\u0642 \u0627\u0644\u0632\u0631 \"\u0631\u062c\u0648\u0639\" \u0641\u064a \u0645\u062a\u0635\u0641\u062d\u0643.";
