    t[269] = "\u064a\u0645\u0643\u0646\u0643 \u062a\u0635\u0641\u062d \u0627\u0644\u0645\u0648\u0642\u0639 \u062f\u0648\u0646 \u062d\u0641\u0638\u0647 \u0641\u064a \u062f\u0641\u062a\u0631 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646. \u0633\u064a\u062a\u0645 \u062a\u0630\u0643\u0631 \u0627\u0644\u0639\u0646\u0648\u0627\u0646 \u062d\u062a\u0649 \u062a\u0642\u0648\u0645 \u0628\u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 I2P \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
    t[276] = "Seeing this page often? See {0}the FAQ{1} for help in {2}adding some subscriptions{3} to your addressbook.";
    t[277] = "\u0631\u0624\u064a\u0629 \u0647\u0630\u0647 \u0627\u0644\u0635\u0641\u062d\u0629 \u0641\u064a \u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0623\u062d\u064a\u0627\u0646\u061f \u0631\u0624\u064a\u0629 \u0647\u0630\u0647 \u0627\u0644\u0635\u0641\u062d\u0629 \u0641\u064a \u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0623\u062d\u064a\u0627\u0646\u061f \u0631\u0627\u062c\u0639 {0} \u0627\u0644\u0623\u0633\u0626\u0644\u0629 \u0627\u0644\u0634\u0627\u0626\u0639\u0629 {1} \u0644\u0644\u0645\u0633\u0627\u0639\u062f\u0629 \u0641\u064a {2} \u0625\u0636\u0627\u0641\u0629 \u0628\u0639\u0636 \u0627\u0644\u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062a {3} \u0625\u0644\u0649 \u062f\u0641\u062a\u0631 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
